css:
.github-CoAuthorForm {
  display: flex;
  flex-direction: column;
  margin-top: 6px;
  padding: 3px;
  border-radius: 0 0 0 0;
  border: 1px solid transparent;
  border-bottom: 0;
  background-color: hsl(220, 13%, 18%);
}
.github-CoAuthorForm-row {
  display: flex;
  align-items: center;
  margin: 3px;
}
.github-CoAuthorForm-row.has-buttons {
  margin: 0;
  flex-wrap: wrap;
}
.github-CoAuthorForm-row.has-buttons .btn {
  flex: 1;
  margin: 3px;
}
.github-CoAuthorForm-row.has-buttons .btn-primary {
  flex: 4;
}
.github-CoAuthorForm-label {
  min-width: 6ch;
}
.github-CoAuthorForm + .github-CommitView-coAuthorEditor {
  margin-top: 0;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
